import Banner from '../components/Banner';

const Home = () => {
	return (
		<>
			<Banner />
			<div class='bg-blue-500 max-w-5xl mx-auto py-12'>
				<h3 class='text-2xl font-semibold text-gray-800'>Book unique homes and experiences</h3>
			</div>
		</>
	);
};

export default Home;
